rule "write_utc_timestamp"
when 
  has_field("timestamp")
then
  let source_timestamp = parse_date(substring(to_string(now("Etc/UTC")),0,23), "yyyy-MM-dd'T'HH:mm:ss.SSS");
  let dest_timestamp = format_date(source_timestamp,"yyyy-MM-dd HH:mm:ss");
  set_field("utc_timestamp", dest_timestamp);
end
